import { registerThemeProperties } from "@ui5/webcomponents-base/dist/asset-registries/Themes.js";

import defaultThemeBase from "@ui5/webcomponents-theme-base/dist/generated/themes/sap_fiori_3/parameters-bundle.css.js";
import defaultTheme from "./sap_fiori_3/parameters-bundle.css.js";

registerThemeProperties("@ui5/webcomponents-theme-base", "sap_fiori_3", defaultThemeBase);
registerThemeProperties("@ui5/webcomponents", "sap_fiori_3", defaultTheme);
export default ".ui5-hidden-text{position:absolute;clip:rect(1px,1px,1px,1px);user-select:none;left:0;top:0}:host{background:var(--ui5-group-header-listitem-background-color);border-bottom:1px solid var(--sapList_TableGroupHeaderBorderColor);color:var(--sapList_TableGroupHeaderTextColor)}.ui5-li-root.ui5-ghli-root{padding-top:1rem;color:currentColor;font-size:var(--sapFontHeader6Size);font-weight:400;line-height:2rem}.ui5-ghli-title{display:block;overflow:hidden;text-overflow:ellipsis;white-space:nowrap;font-weight:700}";
